import React, {Component} from 'react';
import PropTypes from 'prop-types';

import './MyPage.css';

class MyPage extends Component {

    constructor (props){
      super(props);
    }

    render (){
        return (
            <div className = "row">
                <div className = "col-md-4 col-md-offset-4">
                  
                </div>
            </div>
        );
    }
}

export default MyPage;
